import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super()
    this.state = {
     monster1: {
      name:'AKSHAY'
     },
     monster2:{
      name:'Neha'
     },
     monster3:{
      name:'Akshara'
     }
    }
  }
  render() {
    return (
      <div className="App">
        <h1>{this.monster1.name}</h1>
        <h2>{this.monster2.name}</h2>
        <h3>{this.monster3.name}</h3>


      </div>
    );
  }
}

export default App;
